        const getProduct = async () => {
          try {
            const res = axios.get("/http://voicebank.com:8001/api/method/voicebank.voicebank_api.voice_data?language=tamil&gender=&slang=&age=");
            setProduct(res.data);
            console.log(res.data);
          } catch (err) {}
        };
        getProduct();
      }, []);
  return (
    <>
    <div>Test-2</div>
    <h1>{product.first_name}</h1>
    </>
  )
}

export default Test_2
